    justify-content: center;
    padding-top: 3rem;
    @include cel {
      grid-column: 2/-1;
      justify-content: left;
      padding-top: 1rem;
    }
  }
  .bandejaTxt {
    div {
      width: 80%;
    }
    justify-content: left;
    @include cel {
      padding-top: 0;
      div {
        width: 70%;
      }
      justify-content: center;
      .btnAzul {
        text-align: center;
      }
    }
  }
}

#footer {
  h3 {
    text-align: left;
    @include cel {
      text-align: center;
    }
  }
  p {
    font-size: 0.9rem;
    padding-top: 1rem;
  }
  #social {
    li {
      display: inline-block;
      width: 60px;
      padding: 1rem 1rem 0 0;
    }
  }
  .minmax {
    margin-bottom: 5rem;
    #logoPie {
      max-width: 220px;
    }
    @include cel {
      div {
        grid-column: 1/-1;
        text-align: center;
        margin-top: 1.5rem;
